  \ All n people who came to the barbecue sat in a circle (thus each person received\
  \ a unique index bi from 0 to n - 1). The person number 0 started the game (this\
  \ time it was Vasya). All turns in the game were numbered by integers starting from\
  \ 1. If the j-th turn was made by the person with index bi, then this person acted\
  \ like that:\n\n  1. he pointed at the person with index (bi + 1) mod n either with\
  \ an elbow or with a nod (x mod y is the remainder after dividing x by y); \n  2.\
  \ if j \u2265 4 and the players who had turns number j - 1, j - 2, j - 3, made during\
  \ their turns the same moves as player bi on the current turn, then he had drunk\
  \ a glass of juice; \n  3. the turn went to person number (bi + 1) mod n. \n\n\n\
  \nThe person who was pointed on the last turn did not make any actions.\n\nThe problem\
  \ was, Vasya's drunk too much juice and can't remember the goal of the game. However,\
  \ Vasya's got the recorded sequence of all the participants' actions (including\
  \ himself). Now Vasya wants to find out the maximum amount of juice he could drink\
  \ if he played optimally well (the other players' actions do not change). Help him.\n\
  \nYou can assume that in any scenario, there is enough juice for everybody.\n\n\
  Input\n\nThe first line contains a single integer n (4 \u2264 n \u2264 2000) \u2014\
  \ the number of participants in the game. The second line describes the actual game:\
  \ the i-th character of this line equals 'a', if the participant who moved i-th\
  \ pointed at the next person with his elbow, and 'b', if the participant pointed\
  \ with a nod. The game continued for at least 1 and at most 2000 turns. \n\nOutput\n\
  \nPrint a single integer \u2014 the number of glasses of juice Vasya could have\
  \ drunk if he had played optimally well.\n\nExamples\n\nInput\n\n4\nabbba\n\n\n\
  Output\n\n1\n\n\nInput\n\n4\nabbab\n\n\nOutput\n\n0\n\nNote\n\nIn both samples Vasya\
  \ has got two turns \u2014 1 and 5. In the first sample, Vasya could have drunk\
  \ a glass of juice during the fifth turn if he had pointed at the next person with\
  \ a nod. In this case, the sequence of moves would look like \"abbbb\". In the second\
