  \ print any of them.\n\nExamples\n\nInput\n\n3 3 5\n\n\nOutput\n\n18\n3 6\n\n\n\
  Input\n\n2 4 4\n\n\nOutput\n\n16\n4 4\nA: ```n,a,b = map(int, input().split(' '))\n\
